Vamos falar mais sobre a energia que circula pela casa? O banheiro funciona como um "grande ralo" na casa, podendo sugar toda a energia que circula nos ambientes para fora dela. Não acredita nisso? Estude sobre Feng Shui e verá o quanto faz sentido. Existem dois fatores que contribuem para que o banheiro roube energia. O primeiro está ligado à própria finalidade do banheiro - a de recolher e tirar para fora das casas, através dos canos, ralo e privada, todas as impurezas de nossos organismo e água dos banhos e higiene pessoal. Em resumo, o banheiro é programado para tirar para fora da casa nossos dejetos e a água de nossa higiene, através dos encanamentos de água e esgoto.Logo, a função do banheiro é "sugar para fora, tudo que ali
entra", pelos ralos, canos e privada, até a energia que ali entra e circula.
Quer mais um detalhe? Saiba que além de sugar a energia que entra no banheiro, se sua porta ficar constantemente aberta, toda energia do cômodo vizinho é sugada, roubada e retirada da casa.
O segundo fator que ajuda a roubar energia é o fato que o elemento que predomina no banheiro é a água. A água tem polaridade negativa. Isto facilita com que a energia seja puxada para baixo e para os ralos, podendo causar noites mal dormidas, insônia, apatia, ansiedade, falta de interesse sexual se o quarto ficar de frente a um banheiro...
Todos os banheiros devem ficar com as portas sempre fechadas. Isto evitará o roubo de energia dos cômodos
vizinhos, como por exemplo, suites;
Mantenha a tampa da privada sempre abaixada também.
Sem autoria
