Estar consciente da sua respiração força-o a entrar no momento presente, o que constitui a chave para a transformação interior. Sempre que estiver consciente da sua respiração, estará absolutamente presente. Também pode reparar que não é capaz de pensar e estar consciente da sua respiração ao mesmo tempo. 

A respiração consciente faz parar a sua mente. Mas, em vez de estar em transe ou meio a dormir, você está completamente desperto e muito atento. Não está abaixo do pensamento, mas acima dele. E, se observar com mais atenção, vai descobrir que essas duas coisas - estar plenamente no momento presente e deixar de pensar sem perder a consciência - são, na realidade, uma só: o nascer da consciência do espaço.
Eckhart Tolle (Um Novo Mundo)
