Lá vem mais um textão, mas se vc está já consultou ou quer consultar seu voto, sugiro que leia.
Gente, sobre esse aplicativo ou site que o pessoal tem acessado para verificar seu voto:
1 - Eu nunca vou acessar;
2 - Sugiro que não acessem;
3 - Tem dados reais sim, e querem capturar mais dados;
4 - Tem dados de mortos também.
Agora vamos entender o porquê:
1 - Não vou acessar porquê os dados que ali constam podem ser oriundos dos inúmeros vazamentos de dados que tivemos tanto no TSE, como em outros órgãos da justiça. Quem se lembra daqueles 227 milhões de CPF vazados?
Não vou acessar pq não conheço o autor do serviço e não me "cheira bem" algo que é disponibilizado assim, no meio de uma crise política e institucional para que pessoas aleatoreamente preencham mais dados pessoais que, por alguma hipótese, não constassem dos dados vazados. É insano fornecer dados que podem trazer uma identificação pessoal a alguém que não conhecem, principalmente pq é serviço gratuito;
2 - Sugiro que não acessem exatamente pelo mesmo motivo que eu não vou acessar, pois nem o próprio link pode ser garantido que não há nenhum tipo de rastreador, phishing, cookies de terceiros indesejados ou qualquer hacking possível;
3 - Depois dos mega-vazamentos de dados, montar qualquer base confiável é fácil. Passa credibilidade. Depois disso, é só embaralhar aleatoreamente os dados que o sistema já fornece uma resposta plausível que pode te deixar irritado ou contente. Fazer o sistema dizer que você votou em um ou outro candidato é fácil. Mas o mais provável é que vc esteja sendo usurpado dos dados extras que forneceu, como título de eleitor, data de nascimento, etc. Muito suspeito e nada confiável;
4 - O vazamento dos dados de 227 milhões de brasileiros que aconteceu no ano passado foi um belo exemplo de que os mortos foram incomodados em seus túmulos. O Brasil deve ter algo em torno de 211 milhões de pessoas. Os mortos entraram nessa conta também.
Por final, fuja disso tudo.
Meu nome é Emerson Nogueira, sou profissional em inteligência de negócios e projetos de sistemas, se quiser me dar algum crédito, mérito seu. Caso contrário, deixe pra lá!
Que O Nosso Criador nos abençoe e nos livre do mal, em nome de Jesus, Amém.

